import React , { useState } from 'react' ;
import { Link } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import Auxe from '../../Layout/Auxe';
import { WEBSITE_NAME } from '../../../utils/websiteData';


const login = () => {

    const [user , setUser ] = useState ({
        username:'',
        password:'',

    });
    const { username , password } = user;



    return (
        <Auxe>
          <Helmet>
            <title>{`${WEBSITE_NAME} | Login`}</title>
          </Helmet>
          <div className={`${classes.root} card-shadow text-center`}>
            <h3 className='title'>Sign in</h3>
            <h6 className='subtitle'>Use your email and password provided<br></br> by your organization</h6>
    
            <form className='mt-4' onSubmit={onSubmit}>
              <div className='form-group'>
                <input
                  className='input-text'
                  type='text'
                  name='username'
                  value={username}
                  placeholder='Username'
                  onChange={onChange}
                  required
                />
              </div>
    
              <div className='form-group'>
                <input
                  className='input-text'
                  type='password'
                  name='password'
                  value={password}
                  placeholder='Password'
                  onChange={onChange}
                  required
                />
              </div>
    
              {loading ? (
                <Spinner />
              ) : (
                <input
                  type='submit'
                  value='Login'
                  className='button-primary mt-3'
                />
              )}
            </form>
    
            <p className='form-link mt-3'>
              Login Trouble?{' '}
              <Link to='/login'>
                <span>Reset password</span>
              </Link>
            </p>
          </div>
        </Auxe>
      );

}

export default login ;
